	let C = Math.log(Math.tan(Math.PI / 4 + fs / 2)) - B * Math.log(Math.tan(Math.PI / 4 + fc / 2) * ((1 - e * Math.sin(fc)) / (1 + e * Math.sin(fc))) ** (e / 2));
